import React from "react";

function Sectiontitle(props) {
  return (
    <div style={{'text-decoration':'none'}} className="mi-sectiontitle">
      <h2>{props.title}</h2>
      <span>{props.title}</span>
    </div>
  );
}

export default Sectiontitle;
